import {CARGA_ESTUDIANTE} from "../../type/index"

export default (state, action) => {
    switch (action.type) {

    case CARGA_ESTUDIANTE:
        return {
            student: [...state.student, action.payload ]
        }        

        default:
            return state;
    }
}
